import React from 'react';
import '../styles/Alerts.css';

const Alerts = ({ trafficData }) => {
    return (
        <div className="alerts">
            <h2>Alerts</h2>
            {trafficData.map(data => (
                <div key={data.id} className={`alert alert-${data.congestionLevel.toLowerCase()}`}>
                    Alert for {data.location}: Congestion Level is {data.congestionLevel}
                </div>
            ))}
        </div>
    );
};

export default Alerts;
